import React from 'react';
import styled from "styled-components";
import {Icon} from "../icon/Icon";

export const GoTopBtn:React.FC = () => {
    return (
        <StyledGoTopBtn>
            <Icon iconId={"goTop"}/>
        </StyledGoTopBtn>
    );
};

const StyledGoTopBtn = styled.button`
    background-color: rgba(0, 0, 0, 0.3);
    padding: 8px;
    position: fixed;
    right: 30px;
    bottom: 30px;
`
